import styled, {keyframes}from 'styled-components/macro';

export const GridContainer = styled.div`
    display: grid;
    grid-template-columns: repeat(3, 1fr);
    grid-gap: 0px;
    padding: 0px;
`;

export const GridChild = styled.div`
  background-color: #f2f2f2;
  padding: 20px;
`;
